        function closeBloom() {
            jQuery('.bloom-water-guide-Class').css('height', "0");
            jQuery('.bloom-water-guide-Class').css('overflow', "hidden");
            jQuery(".bloomLinkClass").attr("onClick", "openBloom()");
            jQuery(".bloomLinkClass i").removeClass("fa-times");
            jQuery(".bloomLinkClass i").addClass("fa-chevron-down");
            jQuery(".bloomclosebtnClass").css('display', "none");
            jQuery(".bloom-water-guide-Class'").removeClass("showinner");
        }

